script: |
  super -f text -I q11789.spq | sort > q11789.out

inputs:
  - name: q11789.spq
    data: |
      SELECT ALL - col2 * + + 84 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN CAST ( - col1 AS REAL ) * + col1 + + + 35 AND - + col2 + ( ( - col0 ) ) * + - 64;
  - name: tab0

outputs:
  - name: q11789.out
    data: |
